import React from "react";
import '.component'

export default function Blog() {
  return (
    <div>
      <img
        src="https://source.unsplash.com/640x480?technology"
        alt="Technology"
      />
      <p>Tanggal Blog</p>
      <p>Judul Blog</p>
      <p>Summary Blog</p>
    </div>
  );
}
